async function getweb3(){
  try {
    //const path = require("path");
    const Web3 = require("web3");
    const ethNetwork =
      "https://rinkeby.infura.io/v3/5e9731cc1b6c40b4b9e81b8a1c67c05b";

    const web3 = new Web3(new Web3.providers.HttpProvider(ethNetwork));
    return web3
  }catch(e){
    console.log(e)
  }
}
